import React, { useEffect, useState } from 'react';
import { useImages } from '../../context/ImageContext';
import { useAuth } from '../../context/AuthContext';
import Navbar from '../../components/common/Navbar';
import { getImageUrl, getVerifiedImages } from '../../api/images';

const AdminDashboard = () => {
  const { user } = useAuth();
  const { 
    allImages, 
    loading, 
    error, 
    getAllImages, 
    deleteImage,
  } = useImages();
  
  const [verifiedImages, setVerifiedImages] = useState([]);
  const [loadingVerified, setLoadingVerified] = useState(true);
  const [errorVerified, setErrorVerified] = useState(null);

  useEffect(() => {
    const fetchVerifiedImages = async () => {
      setLoadingVerified(true);
      setErrorVerified(null);
      try {
        const response = await getVerifiedImages();
        setVerifiedImages(response.data);
      } catch (err) {
        setErrorVerified(err.response?.data?.error || 'Failed to fetch verified images');
      } finally {
        setLoadingVerified(false);
      }
    };

    fetchVerifiedImages();
  }, []);

  const handleDelete = async (imageId) => {
    if (window.confirm('Are you sure you want to delete this image?')) {
      try {
        await deleteImage(imageId);
      } catch (err) {
        console.error('Failed to delete image:', err);
      }
    }
  };

  return (
    <div>
      <Navbar />
      
      <div className="container">
        <div className="card">
          <h2>Admin Dashboard</h2>
          <p>Welcome, {user?.username}! You have admin privileges.</p>
        </div>
        
        <h3 style={{ marginTop: '30px' }}>All Images</h3>
        
        {loading && <div className="spinner"></div>}
        {error && <div className="alert alert-danger">{error}</div>}
        {!loading && allImages.length === 0 && <div className="card"><p>No images found in the system.</p></div>}
        
        <div className="image-grid">
          {allImages.map((image) => (
            <div key={image.id} className="image-card">
              <img src={getImageUrl(image.id)} alt={`ID ${image.id}`} />
              <div className="image-info">
                <h3>Image #{image.id}</h3>
                <p>SHA256: {image.sha256_hash.substring(0, 10)}...</p>
                <p>Uploaded by: User #{image.uploader}</p>
                <p>Uploaded: {new Date(image.uploaded_at).toLocaleString()}</p>
                <p>Deepfake: {image.deepfake_label} ({Math.round(image.deepfake_confidence * 100)}%)</p>
                <button className="btn btn-danger" onClick={() => handleDelete(image.id)}>Delete</button>
              </div>
            </div>
          ))}
        </div>

        <h3 style={{ marginTop: '30px' }}>Recently Verified Images</h3>
        
        {loadingVerified && <div className="spinner"></div>}
        {errorVerified && <div className="alert alert-danger">{errorVerified}</div>}
        {!loadingVerified && verifiedImages.length === 0 && <div className="card"><p>No recently verified images found.</p></div>}
        
        <div className="image-grid">
          {verifiedImages.map((image) => (
            <div key={image.id} className="image-card">
              <img src={getImageUrl(image.id)} alt={`ID ${image.id}`} />
              <div className="image-info">
                <h3>Image #{image.id}</h3>
                <p>SHA256: {image.sha256_hash.substring(0, 10)}...</p>
                <p>Uploaded: {new Date(image.uploaded_at).toLocaleString()}</p>
                <p>ORB Similarity: {image.orb_features?.similarity_score} %</p>
                <p>SIFT Similarity: {image.sift_features?.similarity_score} %</p>
                <p>Deepfake: {image.deepfake_label} ({Math.round(image.deepfake_confidence * 100)}%)</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
